pragma solidity ^0.4.24;
pragma experimental ABIEncoderV2;

import "./signatureShape.sol";

//0xa3a1fc6166a399a7495b9de6e953473024a424a0
contract Mp4InitData10 is SignatureShape{

    Signature[] public signatures;
    Signature sig;

    constructor() public {
       init();
    }

    function getSignatures() public view returns (Signature[] memory){
        return signatures;  
    }

    function init() public {
        
        FieldValue memory check;

        //1
        delete sig;
        check = FieldValue(1, 0, 0, 44, "meta", "000000000000002068646c7200000000000000006d64697200000000000000000000000000000008696c7374", "BYTE");
        sig.checkValue.push(check);
        check = FieldValue(1, 0, -1, -1, "ftyp", "mp42", "STR");
        sig.checkValue.push(check);
        check = FieldValue(1, 0, 4, 4, "ftyp", "0", "INT");
        sig.checkValue.push(check);
    
        sig.itemType = "MP4_EDITOR";
        sig.itemName = "Movie Make"; // "정보 없음"은 empty로 처리
        sig.idSeq = "ftypmdatmoovmvhdtraktkhdmdiamdhdhdlrminfvmhddinfdrefstblstsdsttsstscstszstcostsstraktkhdmdiamdhdhdlrminfsmhddinfdrefstblstsdsttsstscstszstcostssudtametaXtra";
        sig.creatTime = uint32(now);
        sig.deleteTime = 0;

        signatures.push(sig);

        //2
        delete sig;
        check = FieldValue(1, 0, -1, -1, "ⓒreq", "QuickTime 6.0 or greater", "STR");
        sig.checkValue.push(check);
        check = FieldValue(1, 0, -1, -1, "ⓒenc", "GOM ENCODER (GMp4Writer 1.0)", "STR");
        sig.checkValue.push(check);
        check = FieldValue(1, 0, -1, -1, "ftyp", "isom", "STR");
        sig.checkValue.push(check);
    
