        sig.creatTime = uint32(now);
        sig.deleteTime = 0;

        signatures.push(sig);

        //3
        delete sig;
        check = FieldValue(1, 0, -1, -1, "ⓒreq", "QuickTime 6.0 or greater", "STR");
        sig.checkValue.push(check);
        check = FieldValue(1, 0, -1, -1, "ⓒenc", "GOM ENCODER (GMp4Writer 1.0)", "STR");
        sig.checkValue.push(check);
        check = FieldValue(1, 0, -1, -1, "ftyp", "isom", "STR");
        sig.checkValue.push(check);
    
        sig.itemType = "MP4_EDITOR";
        sig.itemName = "GomMix"; // "정보 없음"은 empty로 처리
        sig.idSeq = "ftypmdatmoovmvhdtraktkhdedtselstmdiamdhdhdlrminfvmhddinfdrefstblstsdsttsstssstscstszco64uuidtraktkhdedtselstmdiamdhdhdlrminfsmhddinfdrefstblstsdsttsstscstszco64uuidudtaⓒreqⓒenc";
        sig.creatTime = uint32(now);
        sig.deleteTime = 0;

        signatures.push(sig);
    }
}
